import{_ as r,o as t,c as a,e as i}from"./app.38696201.js";const g=JSON.parse('{"title":"灵茶题单插件","description":"自动标记题目AC，根据分数、会员等信息显示题目等功能","frontmatter":{"title":"灵茶题单插件","description":"自动标记题目AC，根据分数、会员等信息显示题目等功能"},"headers":[{"level":3,"title":"前言","slug":"前言","link":"#前言","children":[]},{"level":3,"title":"基本功能","slug":"基本功能","link":"#基本功能","children":[]},{"level":3,"title":"演示","slug":"演示","link":"#演示","children":[]},{"level":3,"title":"安装地址","slug":"安装地址","link":"#安装地址","children":[]},{"level":3,"title":"注意","slug":"注意","link":"#注意","children":[]}],"relativePath":"plugins/0x3f-problem-solution.md","lastUpdated":1728735341000}'),l={name:"plugins/0x3f-problem-solution.md"};function s(p,e,n,o,c,h){return t(),a("div",null,e[0]||(e[0]=[i('<h3 id="前言" tabindex="-1">前言 <a class="header-anchor" href="#前言" aria-hidden="true">#</a></h3><p><strong>0x3f-problem-solution</strong> 是根据<a href="https://space.bilibili.com/206214" target="_blank" rel="noreferrer">灵茶山艾府</a> 的 题单而写 ，题单总结很好，可以根据自己目前水准刷题，但是有时候题目过多，或者不想刷某些区间题目，这个时候就可以考虑这个插件了，</p><p><a href="https://leetcode.cn/u/endlesscheng/" target="_blank" rel="noreferrer">点击讨论发布获取题单吧</a></p><h3 id="基本功能" tabindex="-1">基本功能 <a class="header-anchor" href="#基本功能" aria-hidden="true">#</a></h3><ul><li>自定义分数区间后可以显示这个区间的题目 (没有分数的题目无法操作)</li><li>可根据自己需求显示或者隐藏会员题目</li><li>可以根据自己需要是否在收藏题单链接中显示插件</li><li>标记题目状态 （显示题目是否做过，实时刷新）</li><li>隐藏周赛排行榜</li></ul><h3 id="演示" tabindex="-1">演示 <a class="header-anchor" href="#演示" aria-hidden="true">#</a></h3><p>核心功能</p><p><img src="https://scriptcat.org/api/v2/resource/image/GBq7tKYecuNgGaNa" alt="image.png"></p><p>题目ac记录 （在0.0.2 版本开始 ）</p><p>右侧（默认 0.0.4）</p><p><img src="https://scriptcat.org/api/v2/resource/image/ce3YGVmO085A6oHp" alt="image.png"></p><p>左侧 <img src="https://scriptcat.org/api/v2/resource/image/0KF1mwQjiyKGwO3u" alt="image.png"></p><p>按钮可显示隐藏 （ 在0.0.3 版本开始 ）</p><p><img src="https://scriptcat.org/api/v2/resource/image/k2uTTs3i1ZXZSV5d" alt="image.png"></p><p>全屏演示</p><p><img src="https://scriptcat.org/api/v2/resource/image/rrnV2e22Fwn4GmNm" alt="image.png"></p><h3 id="安装地址" tabindex="-1">安装地址 <a class="header-anchor" href="#安装地址" aria-hidden="true">#</a></h3><ul><li><a href="https://greasyfork.org/zh-CN/scripts/501134-0x3f-problem-solution" target="_blank" rel="noreferrer">油猴</a></li><li><a href="https://scriptcat.org/zh-CN/script-show-page/1967" target="_blank" rel="noreferrer">脚本猫</a></li></ul><h3 id="注意" tabindex="-1">注意 <a class="header-anchor" href="#注意" aria-hidden="true">#</a></h3><p>如果使用了<a href="https://greasyfork.org/zh-CN/scripts/450890-leetcoderating-%E6%98%BE%E7%A4%BA%E5%8A%9B%E6%89%A3%E5%91%A8%E8%B5%9B%E9%9A%BE%E5%BA%A6%E5%88%86" target="_blank" rel="noreferrer">LeetCodeRating</a>这个插件，可能会与本插件冲突，但是本插件功能更全面，可以再<code>LeetCodeRating</code>这个插件的设置<strong>不开启</strong>题目AC功能，这样既能使用 <code>0x3f-problem-solution</code> 的题单完整功能，又能看到题目分数</p>',20)]))}const u=r(l,[["render",s]]);export{g as __pageData,u as default};
